import '../estilizacao/HomeEstilo.css';

function Home() {
    return (
        <div className="home-container">
            <div className="sidebar">
                <h1>//Nome</h1>
                <span>Jogos feitos: 0</span>
                <span>Valor ganho: R$ 0,00</span>
                <span>Lista usuários:</span>
            </div>

            <div className="main-content">
                <h1>Bem vindo, Usuário.</h1>
                <p><b>Saldo: R$ 50,00</b></p>
            </div>
        </div>
    );
}

export default Home;
